INSERT [dbo].[Goods] ([Id], [Name], [Price], [Description], [Picture], [Count], [SubcatalogId]) VALUES (1, N'4" Смартфон DEXP A440 8 ГБ розовый [4x1.3 ГГц, 1 Гб, 2 SIM, TN, 800x480, камера 2 Мп, 3G, GPS, FM, 1440 мА*ч]', CAST(3199.00 AS Numeric(18, 2)), N'Смартфон DEXP A440 - оптимальный вариант для непритязательных пользователей. Это устройство готово обеспечить своего владельца возможностью совершать звонки в любых условиях независимо от того, насколько близко он находится к ближайшему населенному пункту, благодаря поддержке сетей 2G и 3G. Модель имеет элегантную розовую расцветку пластикового корпуса. Разграничить личную жизнь и рабочие вопросы поможет возможность использования в этом мобильном аппарате двух SIM-карт одновременно.
На передней панели смартфона DEXP A440 расположился 4-дюймовый экран с разрешением 800x480 пикселей. Функционирующая на базе операционной системы Android 11 Go техника оснащена 4-ядерным процессором Spreadtrum SC7731E и 1 ГБ оперативной памяти. За долгую автономную работу мобильного аппарата отвечает литий-ионный аккумулятор с емкостью 1440 мА*ч.', , 5, 1)
GO
INSERT [dbo].[Goods] ([Id], [Name], [Price], [Description], [Picture], [Count], [SubcatalogId]) VALUES (2, N'4" Смартфон DEXP A440 8 ГБ серый [4x1.3 ГГц, 1 Гб, 2 SIM, TN, 800x480, камера 2 Мп, 3G, GPS, FM, 1440 мА*ч]', CAST(3199.00 AS Numeric(18, 2)), N'Смартфон DEXP A440 - оптимальный вариант для непритязательных пользователей. Это устройство готово обеспечить своего владельца возможностью совершать звонки в любых условиях независимо от того, насколько близко он находится к ближайшему населенному пункту, благодаря поддержке сетей 2G и 3G. Модель имеет элегантную черную расцветку пластикового корпуса. Разграничить личную жизнь и рабочие вопросы поможет возможность использования в этом мобильном аппарате двух SIM-карт одновременно.
