INSERT [dbo].[Goods] ([Id], [Name], [Price], [Description], [Picture], [Count], [SubcatalogId]) VALUES (3, N'4" Смартфон DEXP A440 8 ГБ синий [4x1.3 ГГц, 1 Гб, 2 SIM, TN, 800x480, камера 2 Мп, 3G, GPS, FM, 1440 мА*ч]', CAST(3199.00 AS Numeric(18, 2)), N'Смартфон DEXP A440 - оптимальный вариант для непритязательных пользователей. Это устройство готово обеспечить своего владельца возможностью совершать звонки в любых условиях независимо от того, насколько близко он находится к ближайшему населенному пункту, благодаря поддержке сетей 2G и 3G. Модель имеет элегантную синюю расцветку пластикового корпуса. Разграничить личную жизнь и рабочие вопросы поможет возможность использования в этом мобильном аппарате двух SIM-карт одновременно.
