INSERT [dbo].[Goods] ([Id], [Name], [Price], [Description], [Picture], [Count], [SubcatalogId]) VALUES (4, N'Фитнес-браслет BQ Fit 2.0 [корпус - черный, ремешок - черный, Android 5.0 и выше, iOS 9 и выше, Bluetooth, IP67]', CAST(720.00 AS Numeric(18, 2)), N'Фитнес-браслет BQ Fit 2.0 оснащен одним из самых удобных и функциональных дисплеев – 0,96” OLED. Этот экран отличается насыщенной яркостью и малым энергопотреблением. Благодаря функции синхронизации со смартфоном все уведомления о сообщениях, а также оповещения о входящих и пропущенных вызовах будут выводиться на экран вашего фитнес-браслета. Во время бега, поездок на велосипеде или ходьбы вы всегда будете в курсе частоты вашего пульса, давления, скорости. В случае изменения частоты сердечного ритма фитнес-браслет уведомит вас об этом. Залогом поддержания физической формы станут функции шагомера и расхода калорий, которые обеспечат ежедневный подсчет пройденной дистанции и сожженного лишнего веса. Благодаря функции мониторинга сна вы сможете сформировать наиболее полезный график сна, раз и навсегда покончив с бессонницей и регулярными стрессами, которые становятся последствием хронического недосыпа. Встроенные часы и будильник не дадут пропустить самые важные моменты вашей жизни. Одного заряда аккумулятора хватит до 5 дней автономной работы BQ Fit 2.0.', , 5, 2)
GO
INSERT [dbo].[Goods] ([Id], [Name], [Price], [Description], [Picture], [Count], [SubcatalogId]) VALUES (5, N'Сотовый телефон Joy''s S19 черный [2SIM, 1.44", TFT, 96x68, BT, FM, micro SD, 300 мА*ч]', CAST(550.00 AS Numeric(18, 2)), N'Сотовый телефон Joy''s S19 в элегантном черном корпусе из пластика способен функционировать в рабочих диапазонах GSM 900 и GSM 1800, обеспечивая высочайшее качество мобильной связи. В данной модели можно использовать две SIM-карты, что понравится тем пользователям, чья жизнь связана с постоянными разъездами. Устройство с традиционной моноблочной конструкцией имеет удобную физическую клавиатуру и 1.44-дюймовый экран.
К преимуществам сотового телефона Joy''s S19 можно отнести встроенный MP3. Аккумулятор с емкостью 300 мА*ч гарантирует до четырех часов работы устройства в активном режиме и до 80 часов в режиме ожидания. Модель получила диктофон и FM-радио.', , 5, 3)
GO
INSERT [dbo].[Goods] ([Id], [Name], [Price], [Description], [Picture], [Count], [SubcatalogId]) VALUES (6, N'Стационарный GSM телефон Даджет 3020 [1SIM, SMS, черный]', CAST(1999.00 AS Numeric(18, 2)), N'Как и любой мобильный телефон, стационарный GSM телефон Даджет 3020 может использоваться везде, где есть мобильная связь. Аппарат можно с успехом эксплуатировать не только на даче или в загородном доме, но и в городской квартире. Вы получите в свое распоряжение полноценный стационарный телефон, не требующий прокладки телефонного кабеля. Необходимо будет лишь заранее установить SIM-карту. Эффективность связи в условиях нестабильного приема сигнала (например – в сельской местности или в удаленных дачных поселках) помогает обеспечить внешняя антенна.
Стационарный GSM телефон Даджет 3020 оснащен клавиатурой, имеющей традиционную компоновку. Вы сможете использовать телефонную книгу и SMS. Есть функции повторного набора и громкой связи. Мелодию звонка можно выбирать. Корпус телефона изготовлен из высококачественного пластика. Цвет модели – черный.
Телефон рассчитан на постоянное питание от электрической сети. В комплект поставки входит миниатюрный адаптер питания. Резервное питание (которое актуально при отключениях электричества) гарантирует аккумулятор, имеющий емкость 600 мА·ч.', , 5, 4)
GO
