INSERT [dbo].[Goods] ([Id], [Name], [Price], [Description], [Picture], [Count], [SubcatalogId]) VALUES (8, N'Стационарный GSM телефон BQ 2410 Point [2SIM, SMS, черный]', CAST(2299.00 AS Numeric(18, 2)), N'Стационарный GSM-телефон BQ 2410 POINT предоставит своему обладателю возможность отправлять сообщения, осуществлять необходимые разговоры по громкой связи и множество иных опций. Для вывода необходимой информации устройство включает в себя монохромный дисплей диагональю 2.4 дюйма.
Функционирование модели BQ 2410 POINT производится как посредством зарядного устройства, так и при помощи аккумулятора с увеличенной до 600 мАч емкостью.', , 5, 4)
GO
INSERT [dbo].[Goods] ([Id], [Name], [Price], [Description], [Picture], [Count], [SubcatalogId]) VALUES (9, N'Задняя крышка LP для Nokia Lumia 625 [LP R0000831, черный]', CAST(20.00 AS Numeric(18, 2)), N'Задняя крышка LP для Nokia Lumia 625, исполненная в черной расцветке из матового пластика, предназначена для защиты мобильного устройства от проникновения влаги, песка, пыли, а также для осуществления защиты от последствий активной эксплуатации.
При этом LP для Nokia Lumia 625 повторяет четкие и простые линии совместимого мобильного устройства и обладает прорезными отверстиями для камеры, вспышки, наушников и динамиков. Защитная крышка предназначена для круглосуточной эксплуатации и не мешает ей.', , 5, 8)
GO
INSERT [dbo].[Goods] ([Id], [Name], [Price], [Description], [Picture], [Count], [SubcatalogId]) VALUES (10, N'6.95" Планшет Irbis TZ719 16 ГБ 3G черный [1024x600, IPS, 4х1.3 ГГц, 1 ГБ, BT, GPS, 2000 мА*ч, Android 10.x]', CAST(3999.00 AS Numeric(18, 2)), N'Планшет Irbis TZ719 с диагональю экрана 6.95" поддерживает базовые функции. Две камеры, поддержка Google Mobile Services, GPS, встроенные динамик и микрофон позволяют наслаждаться общением, интернет-серфингом, снимать, отмечать местоположение и делиться с друзьями яркими впечатлениями. Для хранения данных модель использует память 16 ГБ. Если этого объема не хватит, всегда можно установить дополнительно карту памяти, ведь конструкция планшета предусматривает наличие специального слота.
Модуль 3G позволяет планшету Irbis TZ719 ловить сеть в любом месте: даже в общественном транспорте вы можете просматривать свои соцсети. На экране изображение будет четким при разрешении 1024x600 благодаря технологии IPS. Аккумулятор обладает емкостью 2000 мА·ч, поэтому вы сможете на протяжении нескольких часов смотреть видео и не беспокоиться о необходимости подзарядки. Множество возможностей для пользователей открывает система Android 10.x, на основе которой планшет работает.', , 5, 9)
GO
INSERT [dbo].[Goods] ([Id], [Name], [Price], [Description], [Picture], [Count], [SubcatalogId]) VALUES (11, N'7" Планшет Dexp Ursus B17 16 ГБ 3G серый [1024x600, IPS, 4х1.3 ГГц, 1 ГБ, BT, GPS, 2500 мА*ч, Android 10.x]', CAST(3999.00 AS Numeric(18, 2)), N'Планшет Dexp Ursus B17 серого цвета характеризуется функциональностью и удобством. Тонкий корпус с 7-дюймовым экраном занимает минимум места, поэтому устройство можно взять в дорогу или на прогулку. Модель изготовлена из прочного пластика, который не подвержен механическим воздействиям. 4-ядерный процессор и 1 ГБ оперативной памяти обеспечивают высокую скорость работы и производительность.
Для хранения виртуальной информации предназначено 16 ГБ встроенной памяти. Планшет Dexp Ursus B17 имеет слот для карты micro SD, что позволяет увеличить память на 64 ГБ. Подключение к интернету можно осуществлять с помощью модуля сотовой связи 3G или Wi-Fi. Емкостный мультитач-экран безошибочно реагирует на прикосновения. Устройство работает на базе Android 10, что позволяет воспользоваться большим количеством программ и приложений.', , 5, 9)
GO
INSERT [dbo].[Goods] ([Id], [Name], [Price], [Description], [Picture], [Count], [SubcatalogId]) VALUES (12, N'7" Планшет DEXP B27 16 ГБ черный [1024x600, IPS, 4х1.3 ГГц, 1 ГБ, BT, GPS, 2500 мА*ч, Android 11.x]', CAST(4499.00 AS Numeric(18, 2)), N'Планшет DEXP B27 - это невероятно тонкая модель с 7-дюймовым экраном, которая сможет сопровождать вас в любой обстановке. Компактный планшетный компьютер, функционирующий на базе операционной системы Android 11.x+, облачен в прочный пластиковый корпус черного цвета. Благодаря IPS-матрице вы сможете наслаждаться насыщенной цветопередачей и хорошими углами обзора изображения, демонстрируемого в разрешении 1024x600 пикселей. Емкостный мультитач-экран безошибочно распознает одновременное прикосновение к нескольким точкам.
Хорошая производительность планшета DEXP B27 обеспечена 4-ядерным процессором Unisoc SC7731E и 1 ГБ оперативной памяти. Для хранения различных данных и установки приложений имеется 16 ГБ встроенной памяти и возможность оснащения устройства картой памяти micro SD с максимальным объемом 32 ГБ. Поддержка Wi-Fi 802.11 b/g/n позволит подключиться к беспроводной сети Интернет через точки доступа.', , 5, 9)
GO
INSERT [dbo].[Goods] ([Id], [Name], [Price], [Description], [Picture], [Count], [SubcatalogId]) VALUES (13, N'6" Электронная книга Dexp S3 Symbol черный', CAST(4999.00 AS Numeric(18, 2)), N'Электронная книга Dexp S3 Symbol − это компактное устройство для чтения с дисплеем E-Ink Carta, позволяющим проводить за чтением долгие часы, не допуская напряжения зрения. Диагональ книги соответствует 6", что делает ее очень удобным устройством для пользователей, которые предпочитают читать везде − дома, в транспорте, на отдыхе: благодаря компактному корпусу вы сможете взять устройство с собой, куда бы ни направлялись.
Разрешение дисплея Dexp S3 Symbol соответствует 800x600, чего будет достаточно для комфортного восприятия текстовой информации. Для управления функциями книги используются кнопки, расположенные в нижней части корпуса под дисплеем. Особенность электронной книги в поддержке технологии E-Ink, которая подразумевает комфортное отображение символов, словно на настоящей бумаге, позволяя избежать усталости во время чтения. E-Ink Carta обеспечивает более гладкий процесс обновления экрана, чтобы вы могли сосредоточиться на чтении.', , 5, 10)
GO
INSERT [dbo].[Goods] ([Id], [Name], [Price], [Description], [Picture], [Count], [SubcatalogId]) VALUES (14, N'ПК DEXP Aquilon O234', CAST(14999.00 AS Numeric(18, 2)), N'ПК DEXP Aquilon O234 − надежный рабочий аппарат, который будет незаменим как для офисного оснащения, так и для домашнего пользования. Корпус форм-фактора Mini-Tower поможет установить ПК даже в стесненных условиях. Стабильная работа устройства обеспечивается взаимосвязью грамотно подобранных внутренних компонентов. Среди них важное место отводится процессору Intel Celeron J4005, который является сердцем системы. Он обладает двухъядерной конфигурацией и гарантирует стабильность и энергоэффективность, работая на частоте 2000 МГц. Повышение нагрузки на аппарат позволяет процессору увеличивать этот показатель до 2700 МГц.
Быстродействие системы DEXP Aquilon O234, а также отсутствие сбоев в режиме многозадачности обеспечивает модуль 4 ГБ DDR3. Платформой для хранения цифровой информации объемом 120 ГБ служит SSD-накопитель. ПК идет без ОС, поэтому вы получаете возможность выбрать систему, которая будет наиболее удобной для вас.', , 5, 14)
GO
INSERT [dbo].[Goods] ([Id], [Name], [Price], [Description], [Picture], [Count], [SubcatalogId]) VALUES (15, N'ПК Acer Aspire XC-830 [DT.BE8ER.003]', CAST(18999.00 AS Numeric(18, 2)), N'Компьютер Acer Aspire XC-830 - это продуманный дизайн и мощные аппаратные средства, которые предназначены для продуктивной работы в режиме многозадачности. Модель имеет стильный корпус и может устанавливаться на видном месте, являясь отличным дополнением к дизайну интерьера. Сочетание мощного процессора и оперативной памяти с объемом 4 ГБ поможет справится с любыми повседневными задачами. Для подключения внешних устройств и носителей информации разработчики предусмотрели разъемы USB. Их хватит для того, чтобы одновременно подключить к компьютеру принтер и другую оргтехнику, несколько флешек и внешних жестких дисков.', , 5, 14)
GO
INSERT [dbo].[Goods] ([Id], [Name], [Price], [Description], [Picture], [Count], [SubcatalogId]) VALUES (16, N'ПК DEXP Aquilon O238', CAST(19999.00 AS Numeric(18, 2)), N'ПК DEXP Aquilon O238 выделяется классическим исполнением и выполнен в форм-факторе Mini-Tower. Аппаратная платформа с процессором AMD A8 9600, интегрированной графической подсистемой AMD Radeon R7 и 8 ГБ ОЗУ гарантирует сбалансированную производительность для решения повседневных компьютерных задач. Под хранение данных пользователя предусмотрен накопитель SSD объемом 240 ГБ.
Для подключения внешнего оборудования предусмотрен следующий набор интерфейсов: видеоразъем VGA, аудиоразъемы, 4 порта USB 2.0 и 2 порта USB 3.0, коннектор LAN. На передней панели корпуса DEXP Aquilon O238 размещены востребованные порты и кнопки управления. Вентиляционные отверстия способствуют повышению эффективности отвода тепла от внутренних компонентов.', , 5, 14)
GO
INSERT [dbo].[Goods] ([Id], [Name], [Price], [Description], [Picture], [Count], [SubcatalogId]) VALUES (17, N'13.3" Ноутбук Irbis NB77 черный [1366x768, TN+film, Intel Atom Z3735F, 4 ядер х 1.33 ГГц, RAM 2 ГБ, eMMC 32 ГБ, Intel HD Graphics , Windows 10 Home]', CAST(11499.00 AS Numeric(18, 2)), N'Ноутбук Irbis NB77 обладает всем необходимым для удобной и продуктивной работы как в офисе, так и во время поездок. Он выполнен в корпусе с компактными размерами и весом 1.3 кг. Благодаря HD экрану диагональю 13.3 дюйма отображается реалистичная картинка с высокой детализацией и насыщенными цветами. Аудиосистема с двумя динамиками воспроизводит четкий звук.', , 5, 15)
GO
INSERT [dbo].[Goods] ([Id], [Name], [Price], [Description], [Picture], [Count], [SubcatalogId]) VALUES (18, N'AM3+, 4 x 3.8 ГГц, L2 - 4 МБ, L3 - 4 МБ, 2хDDR3-1866 МГц, TDP 95 Вт', CAST(2150.00 AS Numeric(18, 2)), N'Четырехъядерный «народный процессор» AMD FX-4300 OEM, способный работать в четыре потока, позволяет насладиться преимуществами параллельных вычислений в полном объеме. Представитель линейки Vishera AMD FX-4300 OEM гармонично впишется в вашу игровую систему.
3.8 ГГц — номинальная тактовая частота модели, однако чип из серии Black Edition AMD FX-4300 OEM, благодаря открытому множителю и технологии AMD Turbo Core 3.0, способен работать и на частоте 4 ГГц.
Общий объем кэша 8 МБ гарантирует работу процессора AMD FX-4300 OEM на полную мощность, Socket AM3+ делает его совместимым с большинством системных плат, а двухканальный контроллер ОЗУ добавляет поддержку памяти до 1866 МГц частотой и до 128 ГБ объемом.
Вы также останетесь удовлетворены широкой поддержкой наборов команд и технологий — в процессор AMD FX-4300 OEM внедрена поддержка виртуализации, технология экономии энергии, широкий спектр наборов инструкций, в частности, SSE вплоть до 4.2, FMA3, EVP, MMX, XOP и другие.', , 5, 29)
GO
